import React from 'react';
import {ProdctContext} from'../App'
function Pa2() {
  return (
    <div>
   
    <ProdctContext.Consumer>
       Pag2 chld P1
    <br/>
      {
        (data)=>{<div>{data}</div>}
      }
    </ProdctContext.Consumer>
    </div>
  )
}

export default Pa2
